import React from "react";
import { FiDownload, FiMail, FiGithub, FiLinkedin } from "react-icons/fi";
import { motion } from "framer-motion";

const colors = {
  burgundy: "#7B1E28",
  gold: "#F29E4C",
  cream: "#FFF8F0",
  charcoal: "#222222",
};

const easing = [0.6, -0.05, 0.01, 0.99];

const fadeInUp = {
  initial: { y: 40, opacity: 0 },
  animate: {
    y: 0,
    opacity: 1,
    transition: { duration: 0.6, ease: easing },
  },
};

const projects = [
  {
    title: "Python Hybrid Automation Framework",
    desc: [
      "Built scalable automation with Selenium WebDriver & Python.",
      "Implemented Page Object Model (POM) for reusable code.",
      "Data-driven testing with pytest and CSV/JSON data.",
      "Parallel execution and cross-browser support.",
      "CI/CD pipelines using Jenkins and Docker.",
    ],
    tech: ["Python", "Selenium", "pytest", "Jenkins", "Docker"],
    repo: "https://github.com/iamajjayya/selenium-hybrid-framework",
  },
  {
    title: "API Automation Framework",
    desc: [
      "Automated REST API validation with pytest & requests.",
      "Schema validation for response correctness.",
      "Positive & negative test cases.",
      "HTML reports & Jenkins integration.",
    ],
    tech: ["Python", "pytest", "Requests", "Jenkins"],
    repo: "https://github.com/iamajjayya/api-automation",
  },
  {
    title: "E-commerce Website",
    desc: [
      "React.js based e-commerce platform.",
      "User authentication, product listing, cart & checkout.",
      "Focus on seamless UI/UX.",
      "Live: ",
      <a
        key="live"
        href="https://ecommerceajjayya.netlify.app/"
        target="_blank"
        rel="noreferrer"
        className="text-gold hover:underline"
      >
        ecommerceajjayya.netlify.app
      </a>,
    ],
    tech: ["React.js", "REST API", "Authentication"],
    repo: null,
  },
];

export default function App() {
  return (
    <div
      className="min-h-screen bg-cream font-sans text-charcoal p-8 sm:p-16 max-w-5xl mx-auto"
      style={{ fontFamily: "'Poppins', sans-serif" }}
    >
      {/* Header */}
      <motion.header
        initial="initial"
        animate="animate"
        variants={fadeInUp}
        className="mb-16 flex flex-col sm:flex-row justify-between items-center"
      >
        <div>
          <h1
            className="text-5xl font-extrabold mb-2"
            style={{ color: colors.burgundy }}
          >
            Ajjayya G V
          </h1>
          <p
            className="text-lg font-medium"
            style={{ color: colors.gold }}
          >
            QA & Python Automation Tester
          </p>
          <p className="mt-2 text-gray-600 text-sm">
            üìç Electronic City, Bengaluru | üìÖ 05-Apr-2002 | üìû 6366325113
          </p>
        </div>
        <motion.a
          href="/resume.pdf"
          target="_blank"
          rel="noopener noreferrer"
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          className="mt-6 sm:mt-0 inline-flex items-center gap-2 bg-gradient-to-r from-burgundy to-gold text-cream px-6 py-3 rounded-lg shadow-lg font-semibold"
          style={{
            background: `linear-gradient(90deg, ${colors.burgundy}, ${colors.gold})`,
          }}
        >
          <FiDownload size={22} />
          Resume
        </motion.a>
      </motion.header>

      {/* Profile Summary */}
      <motion.section
        initial="initial"
        animate="animate"
        variants={fadeInUp}
        transition={{ delay: 0.1 }}
        className="bg-white rounded-xl shadow-lg p-10 mb-16"
      >
        <h2
          className="text-3xl font-bold mb-6"
          style={{ color: colors.burgundy }}
        >
          üëã Profile Summary
        </h2>
        <p className="leading-relaxed text-lg max-w-prose">
          Detail-oriented QA Tester with <strong>1 year of manual testing</strong>{" "}
          experience and <strong>strong expertise in Python automation</strong>. Skilled
          in building robust automation frameworks using Selenium, pytest, and
          integrating tests into CI/CD pipelines with Jenkins and Docker.
          Passionate about quality, reliability, and bridging manual with
          automated testing.
        </p>
      </motion.section>

      {/* Projects */}
      <motion.section
        initial="initial"
        animate="animate"
        variants={fadeInUp}
        transition={{ delay: 0.2 }}
      >
        <h2
          className="text-3xl font-bold mb-8"
          style={{ color: colors.burgundy }}
        >
          üöÄ Projects
        </h2>
        <div className="grid gap-12 sm:grid-cols-2">
          {projects.map(({ title, desc, tech, repo }, i) => (
            <motion.article
              key={title}
              whileHover={{
                scale: 1.03,
                boxShadow: `0 15px 30px rgba(123,30,40,0.3)`,
              }}
              className="bg-white rounded-xl shadow-md p-6 flex flex-col justify-between"
              initial={{ opacity: 0, y: 40 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.3 + i * 0.15 }}
            >
              <div>
                <h3
                  className="text-xl font-semibold mb-3"
                  style={{ color: colors.burgundy }}
                >
                  {title}
                </h3>
                <ul className="list-disc list-inside space-y-1 mb-4 text-gray-700">
                  {desc.map((line, idx) => (
                    <li key={idx}>
                      {typeof line === "string" ? (
                        line
                      ) : (
                        <span>{line}</span>
                      )}
                    </li>
                  ))}
                </ul>
              </div>
              <div className="mt-auto">
                <div className="flex flex-wrap gap-2 mb-4">
                  {tech.map((tag) => (
                    <span
                      key={tag}
                      className="text-xs font-semibold px-3 py-1 rounded-full bg-gradient-to-r from-burgundy to-gold text-cream"
                      style={{
                        background: `linear-gradient(90deg, ${colors.burgundy}, ${colors.gold})`,
                      }}
                    >
                      {tag}
                    </span>
                  ))}
                </div>
                {repo && (
                  <a
                    href={repo}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="inline-flex items-center gap-2 text-burgundy hover:text-gold font-semibold"
                  >
                    View Repo <FiGithub />
                  </a>
                )}
              </div>
            </motion.article>
          ))}
        </div>
      </motion.section>

      {/* Footer */}
      <footer className="mt-20 text-center text-gray-500 text-sm">
        ¬© {new Date().getFullYear()} Ajjayya G V ‚Äî QA Automation Tester
      </footer>
    </div>
  );
}
